import React from 'react'
import { Row, Col, Avatar, Form, Input, Radio, Select, Button, Divider, Menu, Dropdown, Icon } from "antd";
import "antd/dist/antd.css";
import { _validnumber } from '../../helpers/index';
import "./styles.css";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

const menu = (
    <Menu>
        <Menu.Item>
            <span className="nav-span">
                <Icon style={{ color: '#0984E3' }} type="user" />
                <Link style={{ color: 'rgba(0,0,0,0.65)' }} to="/login">Profile</Link>
            </span>
        </Menu.Item>
        <Menu.Item>
            <span className="nav-span">
                <Icon style={{ color: 'red' }} type="close" />
                <Link style={{ color: 'rgba(0,0,0,0.65)' }} to="/login">Logout</Link>
            </span>
        </Menu.Item>
    </Menu>
);

export default class Header extends React.Component {

    constructor(props) {
        super(props)

        this.state = {
            imgSrc: "data:image/jpeg;base64,",
            user:{}
        };
    }

    componentDidMount() {
        const { user } = this.state
        if (localStorage.getItem("loginGoogle")) {
            console.log('loginGoogle',JSON.parse(localStorage.getItem("loginGoogle")))
            this.setState({
                user: JSON.parse(localStorage.getItem("loginGoogle"))   
                .then(this.setState({
                    imgSrc: user.imageUrl
                }))   
            })
        }
    }

    render() {
        const { imgSrc,user } = this.state
        return (
            <div className="container">
                <div className="main-container">
                    <Row>
                        <Col span={2}>

                        </Col>
                        <Col span={14}>
                            <div className="container-left">
                                <img width="40px" src="data:image/png;base64," />
                            </div>
                        </Col>
                        <Col span={6}>
                            <div className="container-right">
                                {localStorage.getItem("loginGoogle") && <Dropdown overlay={menu} placement="bottomRight">
                                    <img className="img" src={imgSrc} />
                                </Dropdown>}
                                {localStorage.getItem("loginGoogle") && <p style={{color:'white',marginTop:'10px'}}>{user.name} </p>}
                                {!localStorage.getItem("loginGoogle") && <Link style={{ color: 'white' }} to="/login">Đăng nhập</Link>}
                            </div>
                        </Col>
                    </Row>
                </div>
            </div>
        )
    }
}
